  01> 'REED, Megan Charlotte
  b 26.06.1976
  Megan b. at Gisborne. She was educated at Gisborne Girls' High School (1989-94) and boarded at
  Gisborne High School Hostel. She was a prefect, played netball and is a keen outrigger canoe
  paddler. She attended the Auckland Institute of Technology (1995-96) and achieved her Diploma
  of Journalism then joined the RNZAF in the Communication Squad.
  02> REED, Kelly Rachael
  b 06.05.1978
  Kelly b. at Gisborne. She was educated at Gisborne Girls' High School and boarded at Gisborne
  High School Hostel. She was head prefect in 1996, and captain of the senior A school netball
  team which represented the Hawkes Bay / Manawatu region in the Caltex Secondary Schools netball
  championship in 1995 and 1996. She is also interested in outrigger canoe paddling. In 1997
  she attended Waikato University where she is completing a BA in Secondary Education and Leisure
  Studies.
